PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "collectiontime" ("id" INTEGER NOT NULL PRIMARY KEY, "time" DATETIME NOT NULL);
CREATE TABLE IF NOT EXISTS "guild" ("id" INTEGER NOT NULL PRIMARY KEY, "time_id" INTEGER NOT NULL, "guild_id" VARCHAR(255) NOT NULL, "name" VARCHAR(255) NOT NULL, "description" VARCHAR(255) NOT NULL, FOREIGN KEY ("time_id") REFERENCES "collectiontime" ("id"));
CREATE TABLE IF NOT EXISTS "player" ("id" INTEGER NOT NULL PRIMARY KEY, "time_id" INTEGER NOT NULL, "allycode" INTEGER NOT NULL, "name" VARCHAR(255) NOT NULL, "guild_id" VARCHAR(255) NOT NULL, "ship_gp" INTEGER NOT NULL, "character_gp" INTEGER NOT NULL, "gac_league" VARCHAR(255) NOT NULL, "gac_division" INTEGER NOT NULL, "gac_rank" INTEGER NOT NULL, "fleet_rank" INTEGER NOT NULL, "squad_rank" INTEGER NOT NULL, FOREIGN KEY ("time_id") REFERENCES "collectiontime" ("id"));
CREATE INDEX "guild_time_id" ON "guild" ("time_id");
CREATE INDEX "player_time_id" ON "player" ("time_id");
COMMIT;
